import ExpenseForm from './Expense/ExpenseForm';
import './App.css';
import Expenses from './Expense/Expenses';
function App() {
  var expenseList = [
    {
        id: 'e1',
        title: 'Toilet Paper',
        amount: 94.12,
        date: new Date(2020, 7, 14),
      },
      { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
      {
        id: 'e3',
        title: 'Car Insurance',
        amount: 294.67,
        date: new Date(2021, 2, 28),
      },
      {
        id: 'e4',
        title: 'New Desk (Wooden)',
        amount: 450,
        date: new Date(2021, 5, 12),
      }
]
const newExpense = (enteredData) => {
  expenseList = expenseList.push(enteredData)
  expenseList.map(expense => {console.log(expense)})
}
  return (
    <div>
      <h2>This is it</h2>
      <ExpenseForm newExpense={newExpense}/>
      <Expenses expenseList={expenseList}></Expenses>
    </div>
  );
}

export default App;
